import React from 'react';
import '../styles/PouleSchedule.css';

function PouleSchedule({ schedule }) {
  return (
    <div>
      <h2>Wedstrijdschema per Poule</h2>
      {schedule.map((poule, pouleIndex) => (
        <div key={pouleIndex}>
          <h3>Poule {poule.pouleNumber}</h3>
          <table>
            <thead>
              <tr>
                <th>Tijd</th>
                <th>Wedstrijd</th>
                <th>Veld</th>
                <th>Scheidsrechter & Scorekeeper</th>
              </tr>
            </thead>
            <tbody>
              {poule.matches.map((match, matchIndex) => (
                <tr key={matchIndex}>
                  <td>{match.time}</td>
                  <td>{match.teamA} vs {match.teamB}</td>
                  <td>Veld {match.court}</td>
                  <td>Referee: {match.refereeTeam}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
}

export default PouleSchedule;
